import React from "react";

function Index() {
  return (
    <div className="flex flex-col items-center justify-center w-full min-h-screen p-4 max-w-screen">
      <h1 className="text-4xl font-semibold tracking-widest">Welcome</h1>
      <p className="max-w-md">
        I'm Alex Bruns. This is my website. My old one was mostly work focused.
        You can find it{" "}
        <a href="https://alexbruns.dev" target="_blank">
          here
        </a>
        .
      </p>
    </div>
  );
}

export default Index;
